import React from "react";
function Login() {
  return (
    <div className="Login">
      <div className="start">
        <div className="input-box">
          <input type="text" name="" id="" />
          <input type="password" name="" id="" />
        </div>
        <div className="signin-box">
          <p>netflix community에 처음이신가요?</p>
          <Link>회원가입</Link>
        </div>
      </div>
    </div>
  );
}

export default Login;
